INSERT INTO `ieps_inform` VALUES ('400001', '关于2019年“互联网+”大学生创新创业大赛的通知', '100001', '200006', '桂林电子科技大学', '<p><strong>牛啊回复就爱说风凉话</strong></p>\n\n<blockquote>\n<p><em>士大夫发生精神科大夫给</em></p>\n</blockquote>\n', null, '2019-05-19 14:41:03', '2019-05-19 14:41:03', '2019-05-19 14:41:03');
INSERT INTO `ieps_inform` VALUES ('400002', '我校举行第五届中国“互联网+”大学生创新创业大赛赛事解读报告会', '100001', '200006', '桂林电子科技大学', '<p>&nbsp; &nbsp; &nbsp; <strong>4月1日下午，我校第五届中国&ldquo;互联网+&rdquo;大学生创新创业大赛赛事解读报告会在雁山校区图书馆报告厅举行，同时在屏风校区图书馆报告厅设立了直播分会场。北京华富嘉辰投资基金副总裁、万学创世教育科技有限公司CEO兼总裁曾劲先生应邀出席会议并做专题报告。教务处、校团委主要负责人、各学院分管教学副院长、创新创业学院相关老师、指导教师、学院团委书记及重点项目团队成员共计500余人参听了报告。<br />\n&nbsp; &nbsp; &nbsp;报告会上，曾劲先生首先通过思维导图的形式介绍了高校发展学生应具备的素质、创新创业教育的意义，并强调创新创业是高等教育改革的突破口，是提高大学生素质教育的关键。随后，曾劲先生从&ldquo;互联网+&rdquo;大赛的参赛类别和参赛筹备两方面进行了深度解析，深入浅出的分析了创新创业比赛中团队合作、商业模式构建、市场调研、产品定位的重要性及创业大赛作品文案撰写、优化的技巧。最后，曾劲先生通过案例分享他的创业历程和指导经验，并指出&ldquo;互联网+&rdquo;大赛参赛项目具备创新性、团队性和商业性的意义及价值。<br />\n&nbsp; &nbsp; &nbsp; 目前，我校已完成了本届&ldquo;互联网+&rdquo;大赛重点培育项目的征集遴选工作。此次报告会的成功举办，让我校师生对大赛有了更加全面的理解和认识，及时解决了师生备战过程中面临的一些疑惑和问题，为下一阶段项目的深度打磨奠定了基础，积极推动了我校第五届&ldquo;互联网+&rdquo;大学生创新创业大赛参赛工作的顺利开展。</strong></p>\n', null, '2019-05-21 11:58:42', '2019-05-21 11:58:42', '2019-05-21 11:58:42');
INSERT INTO `ieps_inform` VALUES ('400003', '携手并进 共创未来——第四届中国“互联网＋”大学生创新创业大赛参赛经验交流暨第五届参赛动员活动顺利举行', '100001', '200006', '桂林电子科技大学', '<h3>&nbsp;&nbsp;&nbsp;&nbsp;为鼓励更多的学生参与到创新创业活动当中，营造浓厚的创新创业氛围，推进&ldquo;互联网+&rdquo;比赛参赛工作进程，3月12日，第四届中国&ldquo;互联网+&rdquo;大学生创新创业大赛参赛经验交流暨第五届参赛动员活动在雁山校区图书馆报告厅成功举办。我校校友、首届广西&ldquo;高校毕业生创业明星&rdquo;方鹏、何成添以及第四届&ldquo;互联网+&rdquo;大赛广西赛区金奖得主高朋、孙 文 强应邀分享创新创业故事，近300名师生参加活动。校团委副书记莫媛老师出席活动并为特邀嘉宾颁发聘书证书。<br />\n&nbsp;&nbsp;&nbsp;&nbsp;高朋通过路演项目，主要介绍了参赛ppt演讲稿的撰写注意事项，以及答辩过程中自信大方的重要性，并鼓励大家应该要勇敢承担责任，敢闯会创。孙 文 强从解读比赛入手，重点分享了项目计划书撰写、产品开发、团队组建以及路演答辩的方法和技巧。&ldquo;现今的我们处于创业好时代，迎难而上才能找到创新创业的正确方向&rdquo;，方鹏以&ldquo;步入职场、碰上好创业时代、攫取创业第一桶金、项目转折点、辞职下海&rdquo;为主线分享了自己参加创新创业比赛经验和创办VR虚拟旅游科技公司的经历路程，并结合自身感悟鼓励大家吃得苦中苦，方为人上人，不轻言放弃是取得成功的基础。&ldquo;做项目要狠抓市场痛点，做足市场调研并建立合理营销策略。&rdquo;何成添表示，参加&ldquo;互联网+&rdquo;大学生创新创业大赛首先要有自身项目的亮点，其次政策大方向要正确，面对困难要做出合理的判断。他认为，创业就是人生的一种修行，关于人生，没有对错，只有因果，一切都是好的安排。活动最后，特邀嘉宾与现场观众互动，在参赛流程、赛程安排、商业计划书制作、路演答辩、注意事项、创业具备素质等多方面进行了深入交流。<br />\n&nbsp;&nbsp;&nbsp;&nbsp;此次活动给同学们提供了&ldquo;互联网+&rdquo;参赛指导，有效调动了学生们参加创新创业大赛的积极性，也为学校做好第五届&ldquo;互联网+&rdquo;大学生创新创业大赛的准备工作奠定了坚实的基础。</h3>\n', null, '2019-05-21 12:37:13', '2019-05-21 12:37:13', '2019-05-21 12:37:13');
INSERT INTO `ieps_inform` VALUES ('400004', '大学生创新创业基地事务管理中心顺利举办2018-2019年秋季学期述职暨表彰大会', '100001', '200006', '桂林电子科技大学', '<p><strong>&nbsp; &nbsp; &nbsp;12月25日，我校2018年大学生创新创业训练计划项目中期检查答辩会在雁山校区和屏风校区同时举行，本次答辩会的共有160个项目，项目包含全部国家级项目和部分自治区级项目。</strong></p>\n\n<p><strong>&nbsp; &nbsp; &nbsp;答辩项目内容涉及科技创新、技术研发、电子商务、旅游、文化传媒、食品销售等多个领域。各项目负责人分别从各自项目进展情况、项目进展过程中存在的问题、项目取得的阶段性成果、项目下一步的研究计划等方面对项目进行详细的介绍。评委根据创新训练项目的创新性、可行性;创业项目的产品优势、市场前景等进行综合打分。在评委点评环节，各评委根据项目实施情况、项目创新点、项目成果，围绕项目实用性、社会性，从个体到整体，深入分析项目的不足和需要解决的问题以促进项目完善。&nbsp; &nbsp;</strong></p>\n\n<p><strong>&nbsp; &nbsp; &nbsp;此次答辩会的举办，有效推进了各项目的进展，为后续项目的顺利开展奠定了基础，营造了良好创新创业氛围，切实提高了大学生的创新意识和创业能力。</strong></p>\n', null, '2019-05-21 12:42:41', '2019-05-21 12:42:41', '2019-05-21 12:42:41');
INSERT INTO `ieps_inform` VALUES ('400005', '关于公布2019年桂林电子科技大学“大学生创新创业训练计划”校级项目立项的通知', '100001', '200006', '桂林电子科技大学', '<h1>各学院及相关同学：</h1>\n\n<h3>&nbsp; &nbsp; &nbsp;为加强我校学生创新意识和实践能力的培养，全面贯彻我校《关于实施&ldquo;本科教学工程&rdquo;学生创新创业训练计划的通知》（校教通知&nbsp;[2012]30号）的要求。经前期同学申报，学院专家组推荐评审，学校专家组抽查评审，2019年大学生创新创业训练计划校级创新训练项目共立项543项。为了更好地推进计划的实施和项目的管理，现将相关事宜通知如下：</h3>\n\n<h3>一、立项项目</h3>\n\n<h3>请各位同学在电子科技大学大学生创新创业训练智能管理系统中查看，系统网址为：http://cxxl.uestc.edu.cn/。。</h3>\n\n<h3>二、项目合同书提交</h3>\n\n<h3>&nbsp; &nbsp; &nbsp;请各项目负责人按照立项经费标准，在系统中填写项目管理合同书，严格按照合同书规定完成项目。原则上，每项项目只能延期申请一次，延期时间不得超过6个月，否则按照项目终止处理。</h3>\n\n<h3>三、项目管理</h3>\n\n<h3>&nbsp; &nbsp; &nbsp; 1、各学院自主开展项目过程的指导和督查，按要求于2019年4月完成项目中期检查，并于2019年10月完成项目结题验收。学校将根据中期检查情况择优报送2019年省级和国家级创新创业训练计划项目。</h3>\n\n<h3>&nbsp; &nbsp; &nbsp;2、项目立项经费额度以教务处公布的立项情况为准，按项目实际使用情况核定报销。项目经费分三个阶段进行报销使用：公布立项至中期检查阶段，使用额度不超过立项额度的50%；中期检查至结题验收阶段，使用额度不超过立项额度的20%；结题验收后，报销剩余30%的项目经费。未通过中期检查和结题验收的项目立即停止经费报销。</h3>\n\n<h3>&nbsp; &nbsp; &nbsp;3、项目经费审批手续以学院为单位集中申请办理。项目经费审批管理的流程是：项目学生负责人申请&rarr;指导教师审核&rarr;学院大创管理员作经费使用记录&rarr;学院教务副院长审核&rarr;教务处经费项目负责人审核&rarr;财务处报销。</h3>\n\n<h3>&nbsp; &nbsp; &nbsp;4、项目经费的支出范围主要包括专用材料费、委托业务费、调研公共交通费、学生参加会议费、专利申请费、论文版面费及少量信息资料费、印刷费和办公耗材费。</h3>\n', null, '2019-05-21 12:46:12', '2019-05-21 12:46:12', '2019-05-21 12:46:12');
INSERT INTO `ieps_inform` VALUES ('400006', '关于启动2019年桂林电子科技大学国家级、省级“大学生创新训练项目”和“本科生科研训练和实践创新基金项目”申报工作的通知', '100001', '200006', '桂林电子科技大学', '<h2>&nbsp; &nbsp; &nbsp; 根据学校教学工作的安排，现决定启动我校2019年国家级、省级&ldquo;大学生创新训练项目&rdquo;和&ldquo;本科生科研训练和实践创新基金&rdquo;（以下统称&ldquo;大创项目&rdquo;）项目的立项申报工作。现将申报工作注意事项通知如下：</h2>\n\n<h3>一、申报对象</h3>\n\n<h3>&nbsp; &nbsp; &nbsp; 1、项目申报人一般为我校全日制在校的大二、大三本科生，五年制可放宽至大四本科生，项目由所在学院配备指导教师进行指导；</h3>\n\n<h3>&nbsp; &nbsp; &nbsp; 2、鼓励有国家级、省级大学生创新训练项目或西安交通大学本科生科研训练和实践创新基金项目经历的同学申报。</h3>\n\n<h3>二、申报要求</h3>\n\n<h3>&nbsp; &nbsp; &nbsp; &nbsp;1、大学生创新训练项目执行时间原则上为1年，特殊可执行2年，但不得超过申报学生的在校时间；</h3>\n\n<h3>&nbsp; &nbsp; &nbsp; 2、每位学生参与大创项目不得超过2项（申请人身份不超过1项），指导老师应有中级以上职称，每位指导教师指导的大创项目不得超过2项；</h3>\n\n<h3>&nbsp; &nbsp; &nbsp; 3、项目参与人为本科生团队，每个团队人数以3～5人为宜，不超过5人（不允许单独申报），团队组成鼓励学科交叉、跨专业联合，项目成员必须有明确分工；</h3>\n\n<h3>&nbsp; &nbsp; &nbsp; 4、项目必须由学生根据兴趣自主选题，要求选题思路新颖、目标明确，具有创新性和探索性；</h3>\n\n<h3>&nbsp; &nbsp; &nbsp;5、大学生创新训练项目资助金额如下：</h3>\n\n<table border=\"0\" cellpadding=\"1\" cellspacing=\"1\" style=\"width:100%\">\n	<tbody>\n		<tr>\n			<td style=\"vertical-align:top\">\n			<h3>类别&nbsp;专业</h3>\n			</td>\n			<td style=\"vertical-align:top\">\n			<h3>理工医学类</h3>\n			</td>\n			<td style=\"vertical-align:top\">\n			<h3>文史经管类</h3>\n			</td>\n		</tr>\n		<tr>\n			<td style=\"vertical-align:top\">\n			<h3>国家级</h3>\n			</td>\n			<td style=\"vertical-align:top\">\n			<h3>10000元</h3>\n			</td>\n			<td style=\"vertical-align:top\">\n			<h3>6000元</h3>\n			</td>\n		</tr>\n		<tr>\n			<td style=\"vertical-align:top\">\n			<h3>省级</h3>\n			</td>\n			<td style=\"vertical-align:top\">\n			<h3>7000元</h3>\n			</td>\n			<td style=\"vertical-align:top\">\n			<h3>4000元</h3>\n			</td>\n		</tr>\n		<tr>\n			<td style=\"vertical-align:top\">\n			<h3>校级</h3>\n			</td>\n			<td style=\"vertical-align:top\">\n			<h3>5000元</h3>\n			</td>\n			<td style=\"vertical-align:top\">\n			<h3>3000元</h3>\n			</td>\n		</tr>\n	</tbody>\n</table>\n\n<h3>备注：以上为批准立项的平均金额。</h3>\n\n<h3>三、申报流程</h3>\n\n<h3>&nbsp; &nbsp; &nbsp; 1、项目申请人将《西安交通大学大学生创新训练项目申请书》（附件1）纸质版经指导教师签字推荐后提交至学院教务办（根据学院教务办要求），同时项目申请人需登录大学生创新创业项目智能管理系统（http://pts.xjtu.edu.cn:8081/），按照要求填写项目申报书，请项目申请人务必认真填写系统申报书各项内容，并且确保参与人员信息准确完整(报送省厅申报书以系统填报为准)。</h3>\n\n<h3>&nbsp; &nbsp; &nbsp; 2、各学院对申报项目进行评审，请于3月25日前提交《西安交通大学大学生创新训练项目申请项目信息统计表》（附件2）纸质版至实践教学中心，电子版<a href=\"mailto:%E9%A1%B9%E7%9B%AE%E4%BF%A1%E6%81%AF%E7%BB%9F%E8%AE%A1%E8%A1%A8%E3%80%8B%E5%90%8C%E6%97%B6%E5%8F%91%E9%80%81%E8%87%B3%E9%82%AE%E7%AE%B1sjk@mail.xjtu.edu.cn\">发送至邮箱zzhang86@ xjtu.edu.cn</a>（统计表按项目评审成绩排序）。</h3>\n\n<h3>&nbsp; &nbsp; &nbsp; 3、实践教学中心组织专家对申报项目进行评审，确定实践基金项目计划资助的研究项目与资助金额，并划拨学院。</h3>\n\n<h3>四、相关政策</h3>\n\n<h3>&nbsp; &nbsp; &nbsp;1、大学生创新训练项目采取动态考核，将综合中期、结题等考核综合考评进行晋级、淘汰；</h3>\n\n<h3>&nbsp; &nbsp; &nbsp;2、根据学校2019年人才培养工作的部署，请各学院认真组织，完成项目申报数量的指标，确保项目的质量以及学生创新能力培养的效果，该项工作的完成情况纳入各学院2019年人才培养绩效考核指标。</h3>\n\n<h3>联系人：张老师&nbsp;&nbsp; &nbsp;&nbsp;联系电话： 82668901</h3>\n\n<h3>办公室：工程坊A区515</h3>\n', null, '2019-05-22 13:59:32', '2019-05-22 13:59:32', '2019-05-22 13:59:32');
INSERT INTO `ieps_inform` VALUES ('400009', '关于做好参加第五届中国“互联网+”大学生创新创业大赛广西赛区选拔赛“青年红色筑梦之旅”活动启动仪式暨“红色筑梦·青春领航”活动项目遴选推荐工作的通知', '100001', '200006', '桂林电子科技大学', '<h2><strong>各学院：</strong></h2>\n\n<h2><strong>&nbsp;&nbsp;&nbsp; 自治区教育厅定于2019年5月30日在桂林市灌阳县举行第五届中国&ldquo;互联网+&rdquo;大学生创新创业大赛广西赛区选拔赛&ldquo;青年红色筑梦之旅&rdquo;活动启动仪式暨&ldquo;红色筑梦&middot;青春领航&rdquo;活动，根据活动通知精神及结合我校工作实际，决定开展参加活动项目的遴选工作，现将相关工作要求通知如下：</strong></h2>\n\n<h2><strong>&nbsp;&nbsp;&nbsp; 请各学院择优推荐1-2个参加&ldquo;青年红色筑梦活动&rdquo;的项目，可以侧重考虑能够围绕《灌阳县&ldquo;青年红色筑梦之旅&rdquo;扶贫需求汇总表》（附件1）中的需求清单，结合学院自身优势特色，积极发动大学生开展质量兴农、电商兴农、绿色兴农、科技兴农、教育兴农、旅游兴农、红色文化发展、民族文化发展和精准扶贫脱贫等方面开展创新创业实践活动的优质项目，填写项目推荐信息表（附件2）。以学院单位将项目推荐信息表、项目计划书及网评PPT于5月15日前一并发送至<a href=\"mailto:ggtwbgs@126.com\" style=\"font-size:9pt; color:black; text-decoration:none; font-family:宋体\">ggtwbgs@126.com</a>。校赛组委会将根据各学院推荐的情况，遴选1-2支项目团队参加自治区教育厅举办的第五届中国&ldquo;互联网+&rdquo;大学生创新创业大赛广西赛区选拔赛&ldquo;青年红色筑梦之旅&rdquo;活动启动仪式暨&ldquo;红色筑梦&middot;青春领航&rdquo;活动。</strong></h2>\n\n<p><img alt=\"\" src=\"http://127.0.0.1:8080/hub/1559562211055-liberay.jpg\" style=\"height:500px; width:100%\" /></p>\n\n<p>&nbsp;</p>\n\n<p>附件1：<a href=\"http://127.0.0.1:8080/hub/1559562173378-axios.min.js\">http://127.0.0.1:8080/hub/1559562173378-axios.min.js</a></p>\n\n<p>附件2：<a href=\"http://127.0.0.1:8080/hub/1559562193385-vue-resource.min.js\">http://127.0.0.1:8080/hub/1559562193385-vue-resource.min.js</a></p>\n', null, '2019-06-03 19:43:45', '2019-06-03 19:43:45', '2019-06-03 19:43:45');
