INSERT INTO `ieps_item_info` VALUES ('510001', '20190100000001', '1', '1', '“互联网+智慧农业”将新兴互联网信息技术与传统农业生产过程中的管理、生产、加工、销售和服务等方面紧密结合在一起，利用电商平台进行线上销售，减少中间商差价，提高农民的利润。我们采取网络爬虫的方式到各个网站获取相应的数据，利用MySQL和Python等工具代码语言进行数据处理筛选。初期试点凤凰有着丰富的农产品资源，团队已经和当地农业局的相关人员取得联系并约定将在4月假期前去调研。项目实现平台是基于微信的小程序，其已有的能提供第三方支付接口实现支付功能等操作使得技术开发实现难度降低。在后期发展过程中利用网络进行“固定课堂”等农业技能培训课堂，提高产品质量，将生产地和旅游消费结合，进行一个良性循环发展，并且本项目已与凤凰县农业局工作人员取得联系。', '0.00', '0.00', '2019-01-10 22:24:34', '2019-05-10 22:56:47');
INSERT INTO `ieps_item_info` VALUES ('510002', '20190100000002', '1', '2', '无人格子货柜（“3D打印”）超市是集线下无人超市、格子铺、无人快递柜、私人储物柜、线上商城、O2O“3D打印”输入需求输出服务的新型24小时经营的无人便捷超市，适用场景有校园，社区，写字楼，工厂等常驻人口密集的场所；旨在通过移动互联网的输入，超市高效节约时间地输出产品及服务以解决日常琐事，通过需求来改变供应倒逼各行业进行转型的新零售无人超市。', '0.00', '0.00', '2019-01-10 22:24:38', '2019-01-10 22:24:40');
INSERT INTO `ieps_item_info` VALUES ('510003', '20190100000003', '1', '3', '随着“互联网+”时代到来，商品市场逐渐走向个性化定制的方向，其中潜力较大定制服务市场便是服装行业。越来越多的年轻人希望通过独特着装来彰显自己的个性。\r\n针对此类市场需求，本项目将设计一款易于操作的服装设计软件。普通用户可以通过注册服装设计师来取得个性化服务，也可在这款软件上通过模块化设计，进行整体拼装，并把成果呈现在一个服装创意设计分享平台上。\r\n此平台将最快接触到服装需求趋势，并借由此平台进行用户服装需求大数据收集。使得在服装批量生产前就能探查好市场反应，避免供需关系的不对等，也为实体店选址，服装定价策略提供数据支持。\r\n此外，还可以将优秀服装设计制作成三维模型，运用在虚拟人设当中，并将这些人物元素提供给动漫/游戏等制作方，充分提高设计作品的利用率。', '0.00', '0.00', '2019-01-10 22:24:42', '2019-01-10 22:24:45');
INSERT INTO `ieps_item_info` VALUES ('510004', '20190100000004', '1', '1', '目前市场上各种教育软件花样百出，鱼龙混杂，但是缺乏学生与学校、公司企业等用人单位的垂直教育平台。', '0.00', '0.00', '2019-01-10 22:24:47', '2019-01-10 22:24:49');
INSERT INTO `ieps_item_info` VALUES ('510005', '20190100000005', '1', '2', '今年政府工作报告提出，大力实施乡村振兴战略，发展“互联网+农业”，“电商扶贫”因此成为两会热词。在脱贫攻坚的关键时期，如何利用互联网大数据和电商帮助贫困人口脱贫，成为了人们讨论的话题。\r\n在这样的时代背景下，我们团队提出了一个基于互联网大数据的扶贫APP解决方案。\r\n扶贫APP主要有以下功能：\r\n1、提供一个网上销售平台。\r\n2、提供一个扶贫政策发布栏。\r\n3、提供一个物流运输招募平台。\r\n4、提供一个扶贫贷款线上审批平台。\r\n5、提供一个当地特色旅游、优秀传统文化的宣传平台\r\n6、提供一个“三农”技术解决平台\r\n7、提供一个“爱心站”社区\r\n8、提供一个贫困人口基本信息录入和审核平台\r\n9、招商引资\r\n10、大学生暑期实践活动招募。\r\n', '0.00', '0.00', '2019-01-10 22:24:52', '2019-01-10 22:24:53');
INSERT INTO `ieps_item_info` VALUES ('510006', '20190100000006', '1', '3', '本项目将着力研发一套集成超宽带和RFID联合定位，运用在商场，超市，药店，博物馆和医院等地，用于监控人流量及其逗留时间的长短，汇总数据到终端中，分析大数据。如运用在商场中时可以分析人流量和人口密集度分布，可以分析得出人们喜欢逗留的区域，结合物品售出量，得出商品受喜爱程度和价格制定的合理程度。在服务业行业上，能够及时为客户带来最佳的服务选择，以及在紧急情况的发生时能够得出最佳的解决方案。', '0.00', '0.00', '2019-01-10 22:24:55', '2019-01-10 22:24:57');
INSERT INTO `ieps_item_info` VALUES ('510007', '20190100000007', '1', '1', '针对当今人们日益关注空气质量与身体健康的心理特点以及此类产品的市场需求，本项目将着力研发一款具有空气质量检测、火警及煤气泄漏自动报警、以及气候监测功能的时尚美观的空气检测摆件，集一款融合三者功能于一体的智能硬件设备并将开发出一款 Android 版的具有空气检测功能的软件，本项目可用于家庭、工作或学习单位等场景。实现逐步建立用户的环境监测数据，同时提供诸如手机端空气质量快速查询桌面悬浮窗、云存储等服务。准确而实时的检测空气质量，并且满足消费者对此类产品的市场需求以及对装置外观美感的需求。', '0.00', '0.00', '2019-01-10 22:24:59', '2019-01-10 22:25:01');
INSERT INTO `ieps_item_info` VALUES ('510008', '20190100000008', '1', '2', '“闲币APP”是我团队经过长时间反复认证正着手准备开发的一款支付类APP。开发“闲币APP”的目的是解决社会闲置资源、闲置人力、闲置时间以及剩余价值的浪费，并满足人潜在的各种合理需求。主要通过的技术手段就是将原本是被当做空气的资源通过改变支付手段/交换价值手段/记账方式/币值来源来整合开发再利用，通过大数据分析及推荐系统合理建模，开发成一款支付类APP。', '0.00', '0.00', '2019-01-10 22:25:04', '2019-01-10 22:25:06');
INSERT INTO `ieps_item_info` VALUES ('510009', '20190100000009', '1', '3', '本项目致力于开发一款基于深度学习网络，结合用户每天运动的菜单推荐软件，名为DEIT。\r\n本产品结合了市面上现有类似APP的长处，如丰富的运动项目、趣味分享论坛、每天运动消耗建议、每餐摄入食物种类及克数；同时加入了自己的特色，将通过链接智能设备详细收集与记录用户每天的运动数据及体重，记录用户工作强度及身体机能，根据这些数据的动态调整每日运动计划，针对个人定制科学的、可以在不同地点进行的健身食谱；还将配合手机等设备的提醒，构建周边服务如，根据身形扬长避短推荐服饰搭配；为了提升用户的积极性，还将增加富有趣味的运动方式，如定点开宝箱、网络马拉松、运动后奖励红包。', '0.00', '0.00', '2019-01-10 22:25:08', '2019-01-10 22:25:10');
INSERT INTO `ieps_item_info` VALUES ('510010', '20190100000010', '1', '1', '本系统是一套综合性的系统，系统引导一种生活一种习惯，快节奏的生活。我们这个项目主要通过使用两个客户端一个后台对共享酒店系统施行线上管理。酒店或者房东可以通共享酒店的客户端对他们的酒店客房和空置房进行房间上的管理，包括对房间的保洁方面、房间的价格方面、房间的基本信息、房间的家电维修方面都有设计，与各大保洁公司和家电维修公司进行合作，达到快速解决共享房间的各种问题；对住房有临时需求的人可以通过共享酒店的客户端对酒店客房或民宿进行筛选，并挑选与自身需求最匹配的房间，并进行租赁。同时我们对房间进行技术上的改造，增加最新的科技元素; 手机APP一键开锁，方便快捷的控制方式，全自动智能化控制家电，云路由在酒店原有路由器上进行改造，不会造成不必要的资源浪费。并且预设了两种模式：睡眠模式、入住模式供客户所选择。', '0.00', '0.00', '2019-01-10 22:25:12', '2019-01-10 22:25:14');
INSERT INTO `ieps_item_info` VALUES ('510011', '20190100000011', '1', '2', '本项目旨在设计一个基于物联网技术的智慧旅行系统，系统由基于GPS和UWB的高精度定位的导游语音播报系统，基于大数据的智能旅行规划系统，以及景区安全系统组成，可为游客提供一套完整的旅行服务，实现旅行规划、景点介绍、酒店预订等操作，帮助游客享受旅行的快乐，解决出行烦恼，并且为景区管理者提供游客安全及景区保护的相关操作。', '0.00', '0.00', '2019-01-10 22:25:16', '2019-01-10 22:25:18');
INSERT INTO `ieps_item_info` VALUES ('510012', '20190100000012', '1', '3', '基于微信小程序的校园二手书信息发布平台，是一个依托于微信小程序的信息发布平台。用户只需通过微信的小程序入口，找到我们平台的小程序，即可轻松实现信息发布、信息浏览、买卖家沟通对话等操作；买卖家双方在平台上达成共识后，可在线下（即高校特定校区的校园内）进行交易。该平台相对于其他线上信息发布平台的优势在依托于小程序得天独厚的用户优势和小程序的即点即用的特点，在很大程度上解决了平台用户量和用户对于此类平台的粘性低的特点，做到了既有充足的用户来源又能解决用户为了一两次的信息发布或者寻找二手信息而辗转各大平台、下载各大平台的app以及注册各类账号的烦恼。', '0.00', '0.00', '2019-01-10 22:25:20', '2019-01-10 22:25:22');
INSERT INTO `ieps_item_info` VALUES ('510013', '20190100000013', '1', '1', '近年来，随着游戏产业的快速兴起，我国对游戏行业人才的需求也在不断增加，游戏行业人才变得尤为紧俏，据相关数据统计，到目前为止我国游戏行业人才缺口达60万。而在全国众多高校的兴趣团队中，游戏开发团队少之又少。\r\n因此，萤火游戏工作室旨在打造高校优秀的游戏制作平台和人才培养平台，以开发具有教育性和娱乐性并重为特点的游戏为主，主要面向在校大学生，培养大学生的思维创新能力，模拟大型游戏公司项目的分工模式，以培养团队协作能力，为国家游戏行业提供游戏美术设计、游戏开发程序、游戏策划专业性人才。', '0.00', '0.00', '2019-01-10 22:25:23', '2019-01-10 22:25:25');
INSERT INTO `ieps_item_info` VALUES ('510014', '20190100000014', '1', '2', '基于互联网+高校人才培养与网站项目承接平台—旨在解决高校网站开发业务“外流”，“外包”项目达不到预期效果的问题。平台将采取“培训少量收费，项目抽薪”的新型运营模式，并与人才库、项目库进行对接。即与教师合作，无偿培养对网站开发感兴趣的成员，并定期实行考核，筛选人才，分配等级，录入人才库，最后通过项目库发布业务，抽取业务。平台合理调用大学生的可支配时间，解决高校网站业务花费多却实现效果不佳、后期维护与更新不能落实的问题的同时还能改善在校生的生活，实现在校生与高校共赢。', '0.00', '0.00', '2019-01-10 22:25:27', '2019-01-10 22:25:29');
INSERT INTO `ieps_item_info` VALUES ('510015', '20190100000015', '1', '3', '中国幅员辽阔，并且有着上下五千年的历史，因此传承下来了无数的中华瑰宝，其中不乏有精美的手工艺品，可口的美食等。当我们来到一个地区去旅游的时候，看到当地的诸多特产，经常会想着将这些东西给亲朋好友带回去，让他们也感受一下不同的风土人情。但是在很多时候这些特产并不便于挑选与携带，本项目将开发一个基于地方特产的资讯文化平台，在方便游客了解地方特色的同时，便于让他们挑选优质特产，通过快递方式寄送给他们的亲友。从而将中国传统的文化、技艺得到更好的传播。同时，还增设论坛功能，供用户上传的旅游攻略，方便游客到当地进行游玩。', '0.00', '0.00', '2019-01-10 22:25:31', '2019-01-10 22:25:33');
INSERT INTO `ieps_item_info` VALUES ('510016', '20190100000016', '1', '1', '大学校园其实是一个小的社会心态，大学生所关注的，所感兴趣的，所希望了解的，是有其特定的意识形态色彩的。虽然现在很多资讯聚合类的平台，比如今日头条，一条，Flipboard等，但是都是面向普罗大众的，并且其资讯的来源更多依赖UCG和PCG，这里面无形当中就让资讯的获取并不一定能适应大学生的需求。本项目旨在设计一个面向大学生的资讯聚合平台，通过从大学生感兴趣的互联网资讯的爬取入手，结合校园的UCG流通，再配合学校内的各种资讯的互动，比如各种学校内的社团、文学组织、宣传部、学校的通知公告等，让大学生更了解自己圈子。', '0.00', '0.00', '2019-01-10 22:25:35', '2019-01-10 22:25:37');
INSERT INTO `ieps_item_info` VALUES ('510017', '20190100000017', '1', '2', '党的十九大召开会议时，提出新时代要坚持可持续发展。坚定可持续发展战略，是十九大报告重点强调的，并与绿色发展相结合。二手交易就十分的符合这个理念，每样东西制作出来都是需要耗费资源的，如果能够持续利用的话，资源的消耗会减少很多，环境会环保很多。\r\n     给因为毕业需要处理大部分可循环利用的东西或者因为产品的更新换代想换新而出售的的人群提供平台。同时，也给追求性价比而想买二手产品的人群提供渠道。让高校学生有更多的机会选择性价比更高的产品，也可以减小他们的经济压力。', '0.00', '0.00', '2019-01-10 22:25:39', '2019-01-10 22:25:40');
INSERT INTO `ieps_item_info` VALUES ('510018', '20190100000018', '1', '3', '这是一个依托于互联网+垂直信息平台的游泳APP。旨在整合现有资源，提供专业游泳技术指导、票务服务、赛事组织、兴趣社交等功能，打通游泳爱好者、泳馆、教练、线下俱乐部之间的信息壁垒，提高社会资源配置利用率。\r\n目前市场上的专业游泳 APP 十分稀缺，仅有的一两款也是差强人意，对二三线城市的覆盖率几乎为零。也没有任何一个平台对各地游泳馆信息进行收录，无意间在用户和泳馆之间形成了信息鸿沟，游泳场地资源不能合理利用。该项目将充分发挥“互联网+”优势，连通线上线下资源、创新线下教学模式，实现全民游泳健身的目标。', '0.00', '0.00', '2019-01-10 22:25:42', '2019-01-10 22:25:44');
INSERT INTO `ieps_item_info` VALUES ('510069', '20190575977709', '1', '2', '矿山金刚石绳锯机是用来切割开采大理石、花岗岩、砂岩等石材矿及钢筋混凝土、桥梁等的切割拆除设备。作业时，串珠绳锯穿在已钻好孔的石头上，用接头将绳锯联接成封闭锯环，通过装在主电机上的动力轮带动绳锯快速循环运动，同时行走电机通过装在行走减速机上的行走链轮带动绳锯机以一定的速度在轨道上向后移动，实施对石材或钢混的切割。本项目拟通过以矿山机械装备之一绳锯机进行研究与优化，以矿石分割、整形及板材加工为研究对象，拟通过理论分析、数值模拟与试验验证相结合的方法进行研究。', '0.00', '0.00', '2019-05-22 00:57:21', '2019-05-22 00:57:21');
INSERT INTO `ieps_item_info` VALUES ('510070', '20190551913072', '1', '1', '矿山上炸出的较大石块难以装运，一般都要先采用绳锯机分离成便于装运的小石块后再运出矿山以便进一步深加工成石材，对于巨石（直径在1.5——2米）必须先打孔穿绳，两次才能完全分离。而如此深的孔，一般的电钻一次无法完成，两次对打又难以保证对中。本项目拟通过以矿山机械装备的研究与优化为研究方向，以巨石分割前打孔为研究对象，通过理论分析、数值模拟与试验验证相结合的方法进行研究。', '0.00', '0.00', '2019-05-25 10:44:50', '2019-05-25 10:44:50');
INSERT INTO `ieps_item_info` VALUES ('510071', '20190504018626', '1', '1', '', '0.00', '0.00', '2019-05-25 15:13:33', '2019-05-25 15:13:33');
INSERT INTO `ieps_item_info` VALUES ('510072', '20190587374473', '1', '1', '', '0.00', '0.00', '2019-05-25 15:30:22', '2019-05-25 15:30:22');
INSERT INTO `ieps_item_info` VALUES ('510073', '20190509640279', '1', '1', '肝癌作为临床上最常见、恶性程度最高的恶性肿瘤之一。特别是在广西地区居于肿瘤死亡谱首位。磷脂酰肌醇蛋白聚糖3（GPC3）是近年来发现的最有价值的肝癌血清标志物。本项目以肝癌标志物GPC3为研究对象,以GPC3适配体为识别分子，将GPC3适配体固定在纳米铂-钯/还原性氧化石墨烯-壳聚糖-二茂铁（Pt-Pd NPs/RGO-CS-Fc）复合材料修饰的丝网印刷电极表面。利用石墨烯及纳米铂、钯对适配体的高负载能力和良好的电子传递效应，以及适配体对GPC3的特异性识别作用，建立基于氧化石墨烯的GPC3适配体纳米生物传感器，实现血清中GPC3的定量检测。为早期肝癌的诊治提供新的依据和方法。', '0.00', '0.00', '2019-05-25 16:39:30', '2019-05-25 16:39:30');
INSERT INTO `ieps_item_info` VALUES ('510074', '20190554805904', '1', '1', '目前，国内土壤重金属污染十分严峻。土壤一旦被污染后就会丧失农业利用价值，如阳朔兴坪思的村因镉污染而无法种植水稻。要恢复土壤的农业利用价值，钝化土壤中重金属离子是可行的方法之一，因此土壤重金属离子钝化剂的研究很有意义。本项目拟开展以下两方面研究：（1）将固体废弃物如蔗渣、柚子皮、草木灰、橘子皮等改性成具备吸附或者络合重金属离子活性基团的重金属离子钝化剂，并研究这类钝化剂的钝化效果.（2）从导师课题组合成的新化合物中筛选出可行的重金属离子钝化剂，并对其开展钝化效果研究', '0.00', '0.00', '2019-05-25 16:43:38', '2019-05-25 16:43:38');
INSERT INTO `ieps_item_info` VALUES ('510075', '20190523189349', '1', '1', '由于土壤中的镉比较稳定，难以被植物根系吸收。而如果直接加有机酸，成本高。经研究表明，大多数食品加工废水呈酸性，里面含有低分子量有机酸，所以直接加入食品加工废水，可让废水中的有机酸通过溶解、螯合、还原等作用活化土壤中的镉。目前食品加工废水只有各种工艺处理技术，没有研究将其资源化利用的技术方法。本项目，就是利用食品加工废水，考察其提高植物根系对重金属的吸收效率和土壤修复效率，以此达到“以废治废”的目的。', '0.00', '0.00', '2019-05-25 16:48:04', '2019-05-25 16:48:04');
INSERT INTO `ieps_item_info` VALUES ('510076', '20190557568617', '1', '1', '本项目基于PCB加工工艺，提出一种利用针-网结构放电产生的离子风实现载气功能的新方法，并设计出将离子源、迁移区和检测区集成的新型高场非对称波形离子迁移谱（FAIMS，High-field Asymmetric Waveform Ion Mobility Spectrometry）新结构，以实现系统的微型化和集成化。首次将离子风装置应用于FAIMS结构中，省去了庞大复杂的供气系统，实现FAIMS自进样功能，可对人体呼出挥发性气体丙酮进行快速检测。本项目研究可实现FAIMS系统的便携式、微型化以及低功耗，进一步推动FAIMS理论和应用的发展，并为相关便携式分析仪器（如质谱仪等）提供一种高性能的微型气泵和离子源集成系统。', '0.00', '0.00', '2019-05-25 16:50:03', '2019-05-25 16:50:03');
INSERT INTO `ieps_item_info` VALUES ('510077', '20190591489692', '1', '1', '食管癌是常见的消化道恶性肿瘤，是严重威胁生命的疾病。由于食管癌在CT、MRI等影像中与其他组织相差不大，用现有的常规图像分割方法效果很差，目前还没有一个比较好的方法解决。课题组拟利用人工智能、机器学习、图像处理等方法对胸部CT图像进行语义分割，提取食管癌区域，并对结果进行三维重建。课题组的前期实验结果显示食管癌分割正确率超过了95%。本项研究为食管癌的预后预测、个性化治疗等提供技术手段。', '0.00', '0.00', '2019-05-25 16:54:07', '2019-05-25 16:54:07');
INSERT INTO `ieps_item_info` VALUES ('510078', '20190525211726', '1', '1', '为了掌握资源地区农村住宅室内热环境规律特征，本项目拟在资源分别选择1栋传统农村住宅和1栋现代农村住宅，对春、夏、秋、冬四个季节的室内、外热环境进行现场测试，测试的主要参数包括室内的空气温度、湿度、空气流速、辐射温度、壁面温度，室外的空气温度、湿度、太阳辐射强度、风速，对测试结果回归分析，确定室内热环境随室外气候的变化规律，尤其是室内温度随室外温度的变化特征，建立室内热环境评价模型，为农村民居节能设计提供理论支持。', '0.00', '0.00', '2019-05-25 16:55:26', '2019-05-25 16:55:26');
INSERT INTO `ieps_item_info` VALUES ('510079', '20190568841780', '1', '1', '基于Mohr-Coulomb理论，从沥青混合料的抗剪强度和其空隙率、饱和度和矿料间隙率等指标入手，揭示抗车辙级配的影响规律，以解决沥青路面车辙破坏问题。通过室内成型沥青混合试件，研究上述指标与沥青混合料抗车辙性能的影响，采用轮碾成型车辙试件，进行不同级配的车辙试验；根据Mohr-Coulomb理论，摒弃复杂的三轴试验，综合自主设计简便实用的单轴贯入试验和无侧限单轴抗压试验测得沥青混合料的抗剪强度指标；提出抗车辙骨架密实型级配设计方法。', '0.00', '0.00', '2019-05-25 16:56:25', '2019-05-25 16:56:25');
INSERT INTO `ieps_item_info` VALUES ('510080', '20190565389954', '1', '1', '设计研发一套基于惯性导航的全地形轨迹追踪平台，应用于消防探险等危险领域，解决在恶劣且不具备GPS信号的封闭环境下，搜救人员不适宜直接进入内部搜救的险恶情况。其特征是：通过遥控轨迹追踪平台先行进入危险区，通过装载的惯性导航系统绘制平台运动轨迹，为搜救人员提供危险环境的简易地图。技术要求：开发一套精度高，受干扰小的惯性导航系统绘制平台运动路径；设计一套适合各种复杂地形的全地形运动结构；确定一套各类突发情况下平台的应急机制；建立一套配备多种传感器的实时环境数据采集系统。', '0.00', '0.00', '2019-05-25 17:00:24', '2019-05-25 17:00:24');
INSERT INTO `ieps_item_info` VALUES ('510081', '20190540883160', '1', '1', '随着现代微波通信技术和高密度集成器件的飞速发展，新型超低温共烧陶瓷材料（650 °C, ULTCC）的需求日益扩大，成为国内外研究的热点。本项目以CuO-ZnO-B2O3-Li2O体系玻璃为研究对象，着重研究玻璃组成、添加剂和烧结温度对玻璃陶瓷的相组成、微结构和微波介电性能的影响；探索玻璃陶瓷的析晶行为及机理；弄清该系玻璃陶瓷材料和Ag、Al电极的共烧相容性，实现对微波材料性能的有效调控，最终获得几种综合性能优良的ULTCC微波介质材料，为开发新型超低温低介微波材料提供理论指导和实践依据。', '0.00', '0.00', '2019-05-25 17:08:31', '2019-05-25 17:08:31');
INSERT INTO `ieps_item_info` VALUES ('510082', '20190501620169', '1', '1', '随着现代微波通信技术和高密度集成器件的飞速发展，新型低温共烧陶瓷材料（≤700°C, LTCC）的需求日益扩大，成为国内外研究的热点。本项目以MgO-ZnO-B2O3-P2O5体系玻璃为研究对象，着重研究玻璃组成、相组成、添加剂和烧结温度对材料的结构和微波介电性能的影响；探索玻璃陶瓷的析晶行为及机理；弄清该系玻璃陶瓷材料和Ag电极的共烧相容性，实现对微波材料性能的有效调控，最终获得1-2种综合性能优良的LTCC微波介质材料，为开发新型低温超低介低损耗微波材料提供理论指导和实践依据。', '0.00', '0.00', '2019-05-25 17:14:59', '2019-05-25 17:14:59');
INSERT INTO `ieps_item_info` VALUES ('510083', '20190583822043', '1', '1', '氢能作为高效洁净的二次能源，近年来受到人们的广泛关注。但氢的制备技术仍然是制约氢能商业化应用的关键技术。本申请项目拟在Co-B合金中引入稀土金属元素或碳纳米载体，发展具有比表面积大、形貌可控、稳定性好的稀土掺杂的Co-B合金复合材料，改善硼氢化物水解制氢反应的动力学性能。探索提高稀土或碳纳米载体掺杂的非贵金属合金材料催化活性和稳定性的有效方法，为开发新型实用型可控水解制氢催化剂提供理论基础和实验依据。', '0.00', '0.00', '2019-05-25 17:17:10', '2019-05-25 17:17:10');
INSERT INTO `ieps_item_info` VALUES ('510084', '20190503483258', '1', '1', '金属有机框架化合物材料Zn型沸咪唑酯框架（以下简称ZIF-8）具有良好的化学稳定性、超高的比表面积和超大的孔体积等特点，但其存在碳产率低和比电容不高等缺点。本项目拟采用ZIF-8吸附过渡金属离子，采用还原剂对ZIF-8孔道内金属离子进行还原，并以此材料为前驱体在高温下碳化、活化、氧化制备碳包覆的过渡金属氧化物复合材料，发展具有比表面积大、形貌可控、稳定性好、性能优异的新型过渡金属氧化物填充的多孔碳材料，用于超级电容器的电极材料，开发具有高比电容和高稳定性的超级电容器材料。', '0.00', '0.00', '2019-05-25 18:03:34', '2019-05-25 18:03:34');
INSERT INTO `ieps_item_info` VALUES ('510085', '20190516750878', '1', '1', ' 生物质衍生碳材料是一类新型的功能材料,具有较大的比表面积,优异的微观结构和孔隙分布,并含有特殊的杂原子,具有生物质材料的某些特殊功能。该类碳材料在制备燃料电池催化剂时具有一定的优势。本项目拟采用桂林三花酒酒醪和含铁化合物进行掺杂处理,通过预处理、水热/溶剂热碳化、高温碳化、原位同步掺杂、转移掺杂等方法制备掺杂生物质衍生碳材料,并探索ORR催化的一般机理、规律,为设计研发新型的电催化剂提供新的合成技术、路线与方法。', '0.00', '0.00', '2019-05-25 18:04:48', '2019-05-25 18:04:48');
INSERT INTO `ieps_item_info` VALUES ('510086', '20190559431250', '1', '1', '精准扶贫是利国利民的政策，但是不可否认精准扶贫的制度设计还存在问题。随着扶贫开发的纵深推进,扶贫进程中的法治问题也越来越受到人们关注。目前我国精准扶贫已经进入攻坚克难阶段,推进精准扶贫法制建设,将扶贫工作纳入法律轨道,不但是当前依法治国国策的要求,也是精准扶贫得以实现的根本保障。立法是法治的前提和基础。但是目前,我国尚未有全国统一的扶贫立法,因此建立行之有效的精准扶贫法制体系是当下的当务之急。我们将深入广西精准扶贫一线了解扶贫现状，从法律角度分析当前我国农村精准扶贫存在的问题,探索建设农村精准扶贫法制化的可行途径。', '0.00', '0.00', '2019-05-25 18:13:26', '2019-05-25 18:13:26');
INSERT INTO `ieps_item_info` VALUES ('510087', '20190546620444', '1', '1', '本项目互联网+智能医疗护理通过互联网实现网络式集中护理。对每张护理床位上的病患状态可实时通过摄像头、智能生命信息采集仪器检测等方式将病患身体状况数据实时传输并通过上位机方式显示在护理监控中心进行监控，同时实时检测传感器数据是否有异常数据，如有异常则以GSM模块给护士发短信提醒的方式达到对病人及时护理的效果。节省人力，实现反馈病床的创新。', '0.00', '0.00', '2019-05-25 18:15:01', '2019-05-25 18:15:01');
INSERT INTO `ieps_item_info` VALUES ('510088', '20190500543033', '1', '1', '随着物联网的发展，嵌入式产品越来越丰富，涉及行业越来越广。同时嵌入式系统版本的升级迭代速度也越来越快快，当从嵌入式产品安装到客户后，如果工程师想要对嵌入式产品代码进行改错或更新，就必须携带工具进行现场烧写，极大地增加了维修时间及成本。因此我们想到了是否能够通过远程通信方式对嵌入式产品进行固件升级，通过查阅资料我们想到以GPRS通讯方式来解决，以我们最常用的STM32系列为平台特提出了“基于GPRS的STM32固件远程升级系统”。', '0.00', '0.00', '2019-05-25 18:15:45', '2019-05-25 18:15:45');
INSERT INTO `ieps_item_info` VALUES ('510089', '20190596101810', '1', '1', '本项目基于普及极广的智能手机平台，从手机发送开锁请求，云端服务器核对开锁权限后对联网的门锁下达开锁指令。在设备断网的情况下可调用备用的蓝牙开锁方式，发送特定密匙开锁。产品APP可免费下载，每个门锁对应一个核心密匙可用于注册管理员，管理员密码独立设置，下设普通用户权限，可在管理员授权后获得特定时间段的开锁权限，主要用于学校及企业一些公共实验室及办公室的管理。', '0.00', '0.00', '2019-05-25 18:56:41', '2019-05-25 18:56:41');
INSERT INTO `ieps_item_info` VALUES ('510090', '20190589759975', '1', '1', '对称锥权互补问题是一类新的优化问题，是由Rn上的权互补问题推广到对称锥上而来。由于经济学中许多的均衡问题可以通过转化为权互补问题求解，所以关于对称锥上的权互补问题的理论和算法成为了优化领域研究的热点之一。目前关于对称锥权互补问题的理论和算法尚不多见。本项目旨在设计求解对称锥权互补问题的光滑牛顿法，并根据欧几里得约当代数的理论，证明新算法的适定性，全局收敛性和局部二阶收敛性；运用新算法求解Fisher市场均衡问题，并给出相应的数值结果。', '0.00', '0.00', '2019-05-25 19:00:57', '2019-05-25 19:00:57');
INSERT INTO `ieps_item_info` VALUES ('510091', '20190527817253', '1', '1', '稀疏插值被广泛应用在科学和工程领域，也被应用在数学和数值领域，比如指数分析、广义特征值问题、符号计算、正交多项式、信号处理、矩量问题、有理近似理论等。用很少的插值点恢复目标函数，是稀疏插值的重要特性。\n目前，将并行技术应用于插值算法的工作还比较少，实际上，很多稀疏插值算法本身具有内在的并行性。使用并行技术提高稀疏插值算法的效率，对于稀疏插值算法本身及其相关应用都有重要意义。\n课题拟分别对稀疏多元多项式插值算法、稀疏有理函数插值算法进行并行化程序设计，开发专门的软件包，并给出并行稀疏插值算法在一些复杂的几何优化问题求解和多元多项式最大公因式计算上的应用。', '0.00', '0.00', '2019-05-25 19:02:07', '2019-05-25 19:02:07');
INSERT INTO `ieps_item_info` VALUES ('510092', '20190562816210', '1', '1', '桂林电子科技大学坐落于世界著名的风景游览城市—桂林市，是全国四所电子科技大学之一，是广西壮族自治区重点建设高校。本项目拟将桂林电子科技大学的发展历程进行整编和英译研究，一方面促进项目组成员对学校发展历史的了解，加强专业理论知识与实践的紧密结合，提高翻译能力和水平，另一方面积极做好学校的对外宣介，让国外高校和学生更加充分了解桂林电子科技大学的历史文化底蕴，促进校际交流与合作，吸引更多的国际人才。', '0.00', '0.00', '2019-05-25 19:03:19', '2019-05-25 19:03:19');
INSERT INTO `ieps_item_info` VALUES ('510093', '20190593923430', '1', '1', '桂林古桥，建筑宏伟，设计别致，构造精美，久享盛名，充分显示了桂林古代劳动人民的非凡智慧与才能。流水所经之处必有桥，桂林以“山水甲天下”之美誉为国人所闻，潺潺流水为桂林的桥梁文化造就机会。桂林古桥多达数百座，无论是秦汉所筑，还是明清所造，任凭岁月冲刷，古桥仍在，屹立不倒，贯穿一代代人的恬淡生活。随着旅游业的快速发展，桂林古桥体现的民族特色风格吸引了大量游客慕名而来，如花桥、御龙桥等均为桂林的代表性桥梁。基于此，对桂林古桥史料进行整编与英译将有助于为游客提供更完整、更准确的信息，同时也有助于项目组成员更加全面的了解桂林古桥的发展史，提高组员的翻译水平与翻译实践能力。', '0.00', '0.00', '2019-05-25 19:04:17', '2019-05-25 19:04:17');
INSERT INTO `ieps_item_info` VALUES ('510094', '20190549423304', '1', '1', '本项目拟创建广西乡村中学英文思辨教育网络，借助“互联网+”平台，将广西乡村中学联结起来，纳入网络体系，并整合利用广西区内外高校大学生英文思辨人力资源以及国内外英文思辨教学资源，实施线上和线下英文思辨性阅读、写作、演讲、辩论等英文思辨教育项目，包括提供免费课程教育服务以及定期开展各项活动等，以期依托这一网络，切实帮助广西乡村中学学生提高英语应用能力和思辨能力，培养其国际化视野，为塑造广西国际化教育形象做贡献。', '0.00', '0.00', '2019-05-25 19:05:40', '2019-05-25 19:05:40');
INSERT INTO `ieps_item_info` VALUES ('510095', '20190548711897', '1', '1', '本项目针对广西抗战时期红色文化旅游资源没有得到充分开发和利用的现状，拟通过挖掘和整理广西抗战时期红色文化旅游资源的相关史料，并进行优秀的翻译再创作，对外宣传广西抗战时期文化名人故居、文化遗址等红色文化旅游景点的文化内涵和精神价值，让国外游客深入了解广西抗战时期的历史及文化轶事，激发其游览的浓厚兴趣，推动广西文化旅游的国际化发展，促进广西形象的对外传播。', '0.00', '0.00', '2019-05-25 19:06:51', '2019-05-25 19:06:51');
INSERT INTO `ieps_item_info` VALUES ('510096', '20190503796353', '1', '1', '精准扶贫是扶贫开发工作中必须坚持的重点工作。党的十九大提出了“振兴乡村”战略，发起了脱贫攻坚的总攻令，强调坚持精准扶贫、精准脱贫。广西壮族自治区党委举办学习十九大精神研讨班中提出“要坚持精准扶贫、精准脱贫，坚决打赢农村全面脱贫攻坚战”，桂林市拥有3个贫困县、499个贫困村、28.4万农村贫困人口，精准扶贫工作艰巨。市场经济在“精准扶贫”方面具有局限性，此时便需要基层“两委”的力量来进行干预，而“两委”处在扶贫工作的第一线，在精准扶贫的工作中处于核心地位，故本课题拟调查桂林基层“两委”在精准扶贫方面的现状，并针对此现状提出合理的方案，得出如何帮助桂林基层“两委”更好的进行精准扶贫工作的方法，更好的帮助桂林市全面建成小康社会。', '0.00', '0.00', '2019-05-25 19:07:56', '2019-05-25 19:07:56');
INSERT INTO `ieps_item_info` VALUES ('510097', '20190538171666', '1', '1', '本项目从理论分析与实践研究并用的角度出发，针对小型的快递代理点整体运行过程进行分析和研究。通过研究货物抵达后的接货、搬运、分拣、存储、出货等操作流程。运用物理运动学，人因工程学、基础工业工程、机械设计、机械制造、系统仿真等相关的学科知识进行分析和推算使得包裹能够更加快速的分拣、储存和分配，减轻工作人员的工作强度和疲劳程度，减少了不必要的等待时间和寻找时间，大大的提高了工作的效率，提升客户的满意度。', '0.00', '0.00', '2019-05-25 19:09:03', '2019-05-25 19:09:03');
INSERT INTO `ieps_item_info` VALUES ('510098', '20190563652713', '1', '1', '本项目是为了提高盖章工作效率和减轻工作人员的疲劳而提供一个半自动盖章装置设计方案。这款装置运用机械工作原理，将传统的手动盖章，改装为半自动脚踏式盖章。其主要特点是成本低，并且能够轻松、高质量、快速地完成大量的盖章工作，在设计上满足快速定位的要求，其主要目的是为了改良传统办公设备。本项目是以银行、行政部门、业务大厅、学校和一些企业等作为研究对象，为这些工作群体设计一款轻快而方便的盖章工具。', '0.00', '0.00', '2019-05-25 19:10:18', '2019-05-25 19:10:18');
INSERT INTO `ieps_item_info` VALUES ('510099', '20190501687642', '1', '1', '中国-东盟自由贸易区建成之后,广西的边民互市进入一个全新的发展阶段，带动了当地经济的发展，提高边民的收入水平。本项目的在于对广西边民互市现象进行深入的研究,以东兴为切入点,在文献调查以及实地考察,问卷调查的基础上,对所得的数据信息进行整理、分析、归纳和总结。了解东兴市边民互市发展的最新动态,考察现行政策措施给政府、企业和边民各方带来的影响,探究东兴市取得成绩的原因,发现在边民互市贸易政策在执行过程中存在的问题并提出针对性的对策建议。', '0.00', '0.00', '2019-05-28 23:40:37', '2019-05-28 23:40:37');
INSERT INTO `ieps_item_info` VALUES ('510100', '20190525509234', '1', '1', '       该项目以传统中国服饰——旗袍为基础款式，重点强调弘扬中国传统服饰文化。我们借此运用创意设计将传统旗袍进行创新改良，打破旗袍被“固定化”的思想，使其可以更广泛的便于女性日常活动着装。改良旗袍充分释放了女性婀娜多姿的体态，尽显典雅、高贵气质；亭亭玉立，窈窕玲珑，它充分展现了女性纤柔曼妙的身姿。        \n       改良旗袍把传统古典与现代时尚相结合，加入色彩、手绘、图案等气息，并融入西式审美观，延伸和发展了现代改良时尚唐装旗袍，其改良旗袍以表现出中华女性贤淑、典雅、内敛、温柔、清丽的性情与气质。', '0.00', '0.00', '2019-05-28 23:47:21', '2019-05-28 23:47:21');
INSERT INTO `ieps_item_info` VALUES ('510101', '20190548610304', '1', '1', '   特色小镇是具有明确产业定位、文化内涵、旅游特征和一定社区功能的发展空间平台。广西自2017年起开始展开特色小镇的培育工作，主要以建制镇（乡）、产业园区、现代农业核心示范区、特色旅游集聚区等为载体进行培育。本项目拟以广西第一批特色小镇——漓水文化特色小镇（桂林市灵川县大圩镇）为研究对象，以特色小镇旅游文化元素为研究主线，提出其文化传播和旅游衍生商品开发的策略，并展开旅游文创产品的设计实践。', '0.00', '0.00', '2019-05-28 23:48:43', '2019-05-28 23:48:43');
INSERT INTO `ieps_item_info` VALUES ('510102', '20190587202532', '1', '1', '声觉景观设计就是通过研究现代视觉景观所需要配合的声音内容，通过相应的景观元素或景观装置提高声音环境的质量，弱化噪音，美化环境。本项目以桂林市为例，对容易被人忽视的城市声觉景观进行相关研究。研究内容包括城市公共环境声景观现状研究，城市公共环境噪音源研究及对应的声觉景观设计研究。希望借此以抛砖引玉的作用，唤起人们关注自己周围的声音情况，为城市声觉景观设计提供研究基础，营造更为舒适健康的生活环境。', '0.00', '0.00', '2019-05-28 23:51:33', '2019-05-28 23:51:33');
INSERT INTO `ieps_item_info` VALUES ('510103', '20190506490660', '1', '1', '随着私家车数量的飞速增长，行车安全正收到越来越多人的重视。因为车主的大意或不重视，酒驾、疲劳驾驶、疾病突发等等问题引发不可挽回的悲剧。本系统旨在通过车内放置的传感器和车主佩戴的手环监测驾驶员的各项身体指标，辅以云端的大数据统计判断驾驶员目前状态是否适宜开车，是否存在醉酒驾驶、疲劳驾驶或身体指标异常等情况，并及时通过配套的App起到预警与语音提醒的作用，避免安全事故的发生。', '0.00', '0.00', '2019-05-28 23:52:43', '2019-05-28 23:52:43');
INSERT INTO `ieps_item_info` VALUES ('510104', '20190597839088', '1', '1', '随着互联网的发展，越来越多人热衷于使用便携式设备进行动作学习，例如舞蹈，健身。传统视频运动教学以单纯的灌输式知识讲解为主，无法实时评估学习者对于动作的掌握情况，也无法及时反馈指导学习者。\n本项目通过摄像头捕捉学习者动作画面，对视频中的人物动作进行特征提取，应用深度学习动作模型和姿态估计技术来提取关节点，将教学视频动作与学习者动作进行比较计算，得到动作相似度，实现对用户学习效果进行评估，并根据评估结果对学习者进行动作指导、意见反馈。最终达到智能的健身教练机器人效果。', '0.00', '0.00', '2019-05-28 23:53:51', '2019-05-28 23:53:51');
INSERT INTO `ieps_item_info` VALUES ('510105', '20190596165159', '1', '1', '根据中国已步入人口老龄化社会这一现状，大量的老人看护问题日益得到社会广泛关注，工作繁忙的年轻人群体希望拥有一个能远程看护家中老人的系统。\n基于上述背景和人工智能的兴起趋势，本系统涉及机器人、Zigbee通信、安卓APP三大模块，能够实现老人身体数据采集、人机语音交互、人脸识别、远程监控、家居安全等功能，系统能让留守的老人享受到机器人的生活服务，包括家居安全、聊天解闷、播报生活资讯；能够让年轻人通过APP控制机器人远程探望家中老人并获取家中环境信息 ，并获得老人实时的身体健康数据。', '0.00', '0.00', '2019-05-28 23:55:37', '2019-05-28 23:55:37');
INSERT INTO `ieps_item_info` VALUES ('510106', '20190596895360', '1', '1', '本系统旨在设计一个基于物联网技术的AI胶囊旅馆系统，系统由身份识别和二维码扫描的门禁模块、物联网检测安防模块、AI语音识别智能家居控制模块和云服务端等构成。\n用户通过系统客户端查找并预订胶囊旅馆，同时系统能实现客户的自助入住到退房的全自助操作，同时在验证入住后，安防系统实时检测，对烟雾、温度和外界情况检测，超出指标会调整设备的参数或自动报警，并且可以通过语音识别对家居以及其他设备进行控制。', '0.00', '0.00', '2019-05-29 00:00:17', '2019-05-29 00:00:17');
INSERT INTO `ieps_item_info` VALUES ('510107', '20190564078677', '1', '1', '本项目基于移动存储设备损伤或人员失误操作等原因造成的数据删除(主要针对Office文档)，以及人为恶意删除设备的数据，提供给使用者数据恢复或取证方法。当文件被删除时，系统在文件分配表（FAT）内该文件前面写上删除的标志，文件所占存储空间被“假释放”，但能通过扫描磁盘，找到文件被“假释放”的空间，重新建立文件。当文件空间被大量覆盖时，此时数据恢复的可性不大，但可通过尝试恢复文件获取文件的片段信息或者创建者姓名、日期等相关信息，以此达到取证的目的。', '0.00', '0.00', '2019-05-29 00:02:20', '2019-05-29 00:02:20');
INSERT INTO `ieps_item_info` VALUES ('510108', '20190514914482', '1', '1', '近年来机器人领域迅猛发展，水下机器人领域因为使用环境的特殊以及可以解决人们对于深水水域的探索，逐渐受到越来越多的人的关注。在水下却不能使用GPS，北斗，也不可以通过wifi组网的方式来进行定位。但是声纳可以解决海底通信的问题，所以相关领域的专家提出通过声纳来进行水中定位。\n本团队构想出一种通过在水面设立北斗定位的浮标，作为声纳信息的中转，综合北斗浮标自身的定位信息，发送至计算机进行处理，通过球面定位法等算法，可以解算出目标的位置，进行水下机器人的定位。并可以根据水下机器人的定位信息以及各个浮标自身的定位信息进行导航。', '0.00', '0.00', '2019-05-31 00:32:48', '2019-05-31 00:32:48');
INSERT INTO `ieps_item_info` VALUES ('510109', '20190555724477', '1', '1', '本项目将着力研发一套集成超宽带和RFID联合定位，以及人体基本生理指标监测功能的系统，设计一款融合三者功能于一体的硬件设备和一套室内定位算法及软件，实现对于人体的位置感知以及心率等基本生理状态的监测预警功能，本项目可用于养老院、医院等场景，用于实时观察老人精准位置和生理状况，及时救助和预警，亦可用于医院工作人员及设备的管理，提高医院的管理水平和医疗服务质量以及紧急医疗的能力。', '0.00', '0.00', '2019-05-31 00:34:04', '2019-05-31 00:34:04');
INSERT INTO `ieps_item_info` VALUES ('510110', '20190571162473', '1', '1', '由于受四旋翼小型无人机续航能力差的特点，无法实现长时间续航工作依然是制约无人机发展的主要因素。要解决这个问题，就要实现对无人机长时间的供电，本项目主要是来实现无人机自动与地面充电桩电源接口精准连接并改善优化电路结构来实来现快速充电，并可以在地面上多个地点设置这样的无人机充电桩，共同完成在更广阔区域和更长时间内的全自动作业和数据采集。', '0.00', '0.00', '2019-05-31 00:37:17', '2019-05-31 00:37:17');
INSERT INTO `ieps_item_info` VALUES ('510111', '20190554307279', '1', '1', '本项目将基于实时动态定位技术（RTK技术）实现便携式高精度定位系统的设计；该系统硬件主要由UBLOX芯片、arm芯片、4G模块和LCD显示屏等组成，软件系统主要由Linux操作系统、QT和RTKlib软件组成；硬件系统中移动站的UBLOX模块获取到卫星原始数据与移动站通过4G模块获取基准站的差分信息后，利用RTKLIB软件实现差分定位解算，最后得到高精度的定位信息。 ', '0.00', '0.00', '2019-05-31 00:39:39', '2019-05-31 00:39:39');
INSERT INTO `ieps_item_info` VALUES ('510112', '20190580322465', '1', '1', '学生使用仪器时常常会有一些不当的操作，例如探头、探头地线与实验板短路；按错某些功能按键；旋钮调节不当；参数错误设定等。本项目主要用于仪器操作的监控，利用传感器和智能的识别模式，对示波器操作行为进行实时监控，智能判断操作是否正确，并进行反馈及告警，并对仪器操作信息进行记录，通过数据采集传输系统传到中心服务器。本项目能实现仪器操作的纠错，达到辅助教学的目的，能智能地识别操作错误，通过反馈让学生改正错误。', '0.00', '0.00', '2019-05-31 00:41:31', '2019-05-31 00:41:31');
INSERT INTO `ieps_item_info` VALUES ('510113', '20190596749318', '1', '1', '近年来，我国水域污染问题日益严重，江河、湖泊、水库等水域漂浮垃圾随处可见，目前，水域垃圾的清理方式大多采用水面人工打捞与机械清理为主，比较耗费财力。针对这些问题，我们设计了一种水面清理船，能进行水域的监看和水域污染度监测以及自主化清理。并能通过无线数据传输,将清理船搜寻到的信息和水域情况以及自身的状态信息传回地面站，可实时查看清理船的状态信息，供用户了解分析水面状况，并且地面站能设置遥控和自动巡航两种模式，可实现清理船的自动巡航、一键返航等众多功能。', '0.00', '0.00', '2019-05-31 00:43:31', '2019-05-31 00:43:31');
INSERT INTO `ieps_item_info` VALUES ('510114', '20190500843714', '1', '1', '本项目所研究的是自动驾驶技术中的两大核心技术：场景建模与行为决策。对于场景建模，本项目主要研究如何把当前最前沿的深度学习与传统的slam技术和双目算法进行融合，最终根据车载传感器（摄像头、激光雷达、毫米波雷达、红外、超声波等）获取的数据建立一个虚构的、实时的、用于汽车决策的场景模型。行为决策由决策算法给出，本项目致力于如何利用强化学习与机器学习等算法训练出一个能适应于大多数场景的汽车行为策略模型。', '0.00', '0.00', '2019-05-31 00:46:52', '2019-05-31 00:46:52');
INSERT INTO `ieps_item_info` VALUES ('510115', '20190596794601', '1', '1', '随着安保技术的不断发展以及市场的成熟，更快、更准确、更智能已经成为安保系统的和安保行业的发展趋势。本研究的目的是利用图像处理技术、智能感知技术、嵌入式技术，人脸识别技术来构建智能安保系统。研究内容包括：利用广角摄像头和基于云台的枪机摄像头搭建安保平台，并实现巡逻监控和运动目标检测功能；应用动态图像处理技术和跟踪算法实现监控场景中的运动目标检测和提取；由目标检测数据触发和驱动云台锁定目标并进行高清抓拍，并在后台利用人脸识别技术对图像进行识别，等等。', '0.00', '0.00', '2019-05-31 00:49:14', '2019-05-31 00:49:14');
INSERT INTO `ieps_item_info` VALUES ('510116', '20190517950659', '1', '1', '本项目是基于北斗卫星导航的形变安全实时监测系统。高精度形变监测系统包括BDS/GNSS精密基准站、BDS/GNSS形变监测站以及监测平台。监测软件进行数据实时自动采集、传输、存储、处理，进而实现对桥梁、大坝、电力杆塔、公路边坡、尾矿库、采空区位移以及路基沉降等形变实时监测和安全预警。', '0.00', '0.00', '2019-05-31 00:52:12', '2019-05-31 00:52:12');
INSERT INTO `ieps_item_info` VALUES ('510117', '20190558105666', '1', '1', '无人机正逐步向微型化、集成化、智能化、成本低、功耗低的方向发展，从而使其在军事和民用领域应用越来越广泛化。由于无人机的结构特点，其在空中飞行时，飞行的稳定性很容易受到气流和风速等因素影响，因此为了保证无人机的飞行稳定性，通常采用以无人机的姿态信息作为反馈信息的姿态稳定回路来控制无人机的稳定性，本项目通过BDS-RTK三天线定向测姿及MEMS微惯性传感姿态解算的数据融合，实现飞行器等高动态载体实时姿态角测量及姿态精准控制，具有环境适应力能力强、计算量小、误差小、更新率高、稳定性高、实时性强、高精度的姿态测量的能力，而保障了无人机在飞行过程中的安全和稳定。', '0.00', '0.00', '2019-05-31 00:53:29', '2019-05-31 00:53:29');
INSERT INTO `ieps_item_info` VALUES ('510118', '20190516403202', '1', '1', '当今世界汽车工业竞争不断加剧，而国产汽车挡风玻璃的测量精度和可靠性并不乐观。针对世面上现有玻璃测量系统在检测精度、出错率、检测效率、项目耗资等各方面的不足，提出了新型的设计方案。本项目采用位移检测技术，精度高可以达到微米；通信上摒弃了原有的方式，抗干扰能力大大提高，极大的提高了数据传输可靠性；完善的电脑数据后处理功能，输出的SPK值、 SPC值、CPK值、均值图、极差图、上下控制线、CKP值为生产厂家改进生产工艺，提高产品质量有极大的帮助。项目的实施必将促进国内汽车玻璃生产实现脱胎换骨般的跨越，缩短国际竞争之间的差距，为国产品牌树立良好的口碑，促进汽车行业的繁荣与发展。', '0.00', '0.00', '2019-05-31 00:55:15', '2019-05-31 00:55:15');
INSERT INTO `ieps_item_info` VALUES ('510119', '20190535740289', '1', '1', '本项目设计的是一个自动竹笋剥皮机，它主要由储料装置、进料机构、传送机构、去皮机构组成。在工作时，竹笋放置于仓盒中，在出料口将一根笋由推动装置推至导槽处，再由电动推杆将笋推至竹笋固定套中，固定套带着竹笋运动到去皮工作位，上下去皮针插入笋的皮层后反向转动去除笋皮，去皮结束后固定套返回至初始位置，返回过程中笋皮挡板会将笋皮从针尖上去除。本作品可以代替传统的手工去除笋皮，单次去笋皮时间少于手工剥皮时间，既解放了人的双手又使得总体效率提高；电动推杆采用折叠形式存放，且体积较小，可根据具体环境灵活选择放置位置。', '0.00', '0.00', '2019-05-31 00:56:40', '2019-05-31 00:56:40');
INSERT INTO `ieps_item_info` VALUES ('510120', '20190513686775', '1', '1', '基于企业生产实际需求，针对目前整体式波形片（由8个子片组成）冲压成形过程中手动更替子片的现状，为提高生产效率与安全性，本项目提出一种整体式波形片自动放取件及其成形装置。经前期研究，拟定该套装置由自动放取件机构、回转式工作台、核心冲压装置等组成。其中，放取件机构用以达成波形片工件的自动放取过程，回转式工作台在实现拟定量波形片间交替转换（公转）的同时，还可在周期范围内完成子片工位的传输与定位（自转）；核心冲压装置则用以确保波形片各子片成形精度的一致性。与传统加工方法相比，该装置对于整体式波形片的生产更具实际效益。', '0.00', '0.00', '2019-05-31 00:57:43', '2019-05-31 00:57:43');
INSERT INTO `ieps_item_info` VALUES ('510121', '20190589026137', '1', '1', '本产品外形为箱子式的小车，物品存放在载货箱内，通过电动推杆控制箱体盖自动开合；其四个车轮为麦克纳姆轮，可实现机器人的全向行驶，小车在上楼梯前先由撑轮抬高车体，使履带与阶梯边接触后再收起撑轮，电动推杆则是起到在跨越障碍或上下楼梯时保持机器人平衡的作用，即将完成上下楼梯任务时再将辅助撑轮放下，辅助履带完成上下楼梯任务。', '0.00', '0.00', '2019-05-31 01:01:17', '2019-05-31 01:01:17');
INSERT INTO `ieps_item_info` VALUES ('510122', '20190559870201', '1', '1', '当今时代快速发展，网络已经成为绝大多人不可缺少的一部分，随着铺设的光纤数量越来越多,覆盖的范围更加广阔,光纤光缆所负载的业务量也在不断的增大,如果发生了故障,将会给整个通信网络造成极大的损失，为此本产品提供一个切换设备，便捷在于控制不同的设备的时候提供切换，而不会为单一控制一个控制的时候，以及便捷在维护方面，更加容易得去检测维护，可以快速转换到正常的线路上提供快速的维护，保证正常的使用。', '0.00', '0.00', '2019-05-31 01:02:13', '2019-05-31 01:02:13');
INSERT INTO `ieps_item_info` VALUES ('510123', '20190558767632', '1', '1', '金属材料的微观组织特征会影响其弹性模量、电阻率及导热率等力学及物理性能，然而相关力学和物理参量在微尺度的实验测量极其困难甚至无法实现。本项目将开发基于微观图像识别的材料性能评估方法，建立物相属性数据库，通过有限元方法揭示物相成分和组织形态等对弹性模量、电阻率及导热率等物理量的影响规律，实现复杂微观组织金属材料力学及物理性能的快速测定，促进金属材料微区性能检测技术的发展', '0.00', '0.00', '2019-05-31 01:03:43', '2019-05-31 01:03:43');
INSERT INTO `ieps_item_info` VALUES ('510124', '20190537545163', '1', '1', '本项目将实现对真实环境中的导航信号进行记录与回放的设计。该系统硬件主要由下变频和上变频电路模块、模数转换和数模转换电路模块、FPGA电路模块、USB3.0电路模块组成，软件主要是针对FPGA开发的Verilog语言和上位机的QT开发环境或Java开发环境语言；系统首先由下变频把1.2GHz-1.6GHz的卫星信号变频到4MHz左右的信号后，通过A/D转换送到FPGA进行处理并由USB模块上传到上位机存储，通过上位机控制把存储数据通过USB下传到FPGA后，送到D/A转换，由上变频将4MHz变频到1.2GHz-1.6GHz的信号。', '0.00', '0.00', '2019-05-31 01:09:13', '2019-05-31 01:09:13');
INSERT INTO `ieps_item_info` VALUES ('510125', '20190522857474', '1', '1', '智能巡线末端无人运输车的出现能够为物流公司降低人力运输的成本并提升运输效率，由于采用巡线的方式降低了图像处理的难度并增加了行驶过程中的安全性，独立可更换车箱能运输更多类型和大小的物品。', '0.00', '0.00', '2019-05-31 01:14:20', '2019-05-31 01:14:20');
INSERT INTO `ieps_item_info` VALUES ('510126', '20190541017691', '1', '1', '本项目计划基于对语音识别系统的基本原理和隐马尔科夫模型(HMM)的基础上分析传统的语音识别方法及其优缺点。项目重点搭建基于深度学习的多层神经网络的语音识别系统，对标准误差反向传播(BP)算法和改进的 BP 算法进行实验，通过对比改进方案前后的实验效果，提高网络训练速度，提高语音识别系统的效率和准确率，以达到实时的识别效果。', '0.00', '0.00', '2019-05-31 01:16:38', '2019-05-31 01:16:38');
INSERT INTO `ieps_item_info` VALUES ('510127', '20190582261060', '1', '1', '本系统通过传感器网络收集畜牧的身体状况及养殖环境的各项参数，而非依靠低效的人工操作。将分布式传感器节点网络收集到的数据通过网关设备传输到PC终端和移动终端，进行数据分析和处理，从而达到远程监控的目的，并根据数据采取适当措施进行养殖管理和畜牧改进。', '0.00', '0.00', '2019-05-31 01:18:12', '2019-05-31 01:18:12');
INSERT INTO `ieps_item_info` VALUES ('510128', '20190550866358', '1', '1', '本创新训练项目是研发和制作基于可见光LED的通信系统，主控芯片采用LPC1768FBD100，采用可见蓝光LED经过8-PPM调制发送，接收端采用PIN二极管接收光脉冲信号，经过放大滤波电路，解调后得出发送端信号。本次项目传输信道为海洋，水下环境对光通信有一定干扰，拟采取加入纠错电路，通过接收端射频电路对发送端进行反馈重发，减少误码率。', '0.00', '0.00', '2019-05-31 01:19:37', '2019-05-31 01:19:37');
INSERT INTO `ieps_item_info` VALUES ('510129', '20190523051886', '1', '1', '人工智能在过去的十年里取得了令人叹为观止的进步，其存在在很多方面拓展了人类的认知与实践，当然也增强了我们想象与设计的能力。本创新方案为基于深度学习的语音转化至图像系统，运用人工智能技术实现语音识别、关键词提取和图像的自动生成，使用户在表达出所期望的图案特征后，就能如愿以偿地得到相应的图案。若能进一步发展，还能协助警方根据目击者的描述来画出嫌疑人的面部。这一过程自动而高速，节约人脑思考的成本，应用前景广泛。', '0.00', '0.00', '2019-05-31 01:21:13', '2019-05-31 01:21:13');
INSERT INTO `ieps_item_info` VALUES ('510130', '20190502558922', '1', '1', '人工智能在过去的十年里取得了令人叹为观止的进步，其存在在很多方面拓展了人类的认知与实践，当然也增强了我们想象与设计的能力。本创新方案为基于深度学习的语音转化至图像系统，运用人工智能技术实现语音识别、关键词提取和图像的自动生成，使用户在表达出所期望的图案特征后，就能如愿以偿地得到相应的图案。若能进一步发展，还能协助警方根据目击者的描述来画出嫌疑人的面部。这一过程自动而高速，节约人脑思考的成本，应用前景广泛。', '0.00', '0.00', '2019-05-31 01:23:42', '2019-05-31 01:23:42');
INSERT INTO `ieps_item_info` VALUES ('510131', '20190508585538', '1', '1', '随着人们对定位和导航的需求日益增大，已有的GPS、北斗等导航系统不能满足人们在大型建筑物内定位的需求。\n本项目设计的基于MEMS（Micro-Electro-Mechanical System，微机电系统）传感器和蓝牙信标的室内导航系统，可以在室内进行导航定位，提供导航信息。多MEMS传感器采集数据交由ARM芯片处理，而蓝牙信标校准定位则可降低传感器数据误差以及算法积累的误差。同时开发了手机终端app与系统连接进行导航显示，满足人们在大型商场、超市、机场大厅、停车场等室内环境的导航需求。', '0.00', '0.00', '2019-05-31 01:25:44', '2019-05-31 01:25:44');
INSERT INTO `ieps_item_info` VALUES ('510132', '20190567757652', '1', '1', '本次设计的北斗手环是基于北斗技术与无线通信的一种智能报警手环。本手环可以实现防走失报警功能、实时定位功能和无线通信功能。在出现紧急走失状况时，手环可以通过无线通信功能发出报警信号以及实时定位信号，并且可以为监护人查询最优路径去寻找走失的老人和小孩等，极大程度上缩短了寻找时间和提高了救援效率。本项目的北斗智能报警手环集成度高、功耗低、操作简单，可以快速投入到日常生活中，为个人的安全提供保障。', '0.00', '0.00', '2019-05-31 01:27:05', '2019-05-31 01:27:05');
INSERT INTO `ieps_item_info` VALUES ('510133', '20190568055146', '1', '1', '本项目通过三维成像技术与专门的健身器材相结合，通过热感成像，关节扫描，骨骼模拟等技术，对健身对象进行实时的监控和模拟，以及通过实景摄像记录健身者视野盲区；再通过屏幕实时传回监控对象的动作画面或者3D虚拟动图，并结合一个标准的动作完成图，让健身对象能够一边健身一边矫正动作；再依托成熟的算法，把健身对象的心率，卡路里消耗等人体参数传回屏幕。通过本项目可以让广大健身爱好者进行更低成本，更高效率的健身。', '0.00', '0.00', '2019-05-31 01:28:08', '2019-05-31 01:28:08');
INSERT INTO `ieps_item_info` VALUES ('510134', '20190549455359', '1', '1', 'LoRa 是一种基于扩频技术的超远距离无线传输技术，LoRa技术具有远距离、低功耗（电池寿命长）、多节点、低成本的特性。运动员需要科学的训练方法才能保证强身健体并有效提升相关运动成绩。课题应用传感器、通信等技术结合实际训练过程设计一套基于LoRa技术运动参数在线监测装置。采用便携式腕带采集运动员生理信息，采用微传感器模块等监测运动过程的参数变化，并运用LoRa技术的无线通信模块进行实时数据传输。在远端服务器实时显示各体能等参数，经评估给出参考训练建议。该系统具有通信距离远，功耗低的优点；同时通过实时监测运动员生命体征，有助于防止意外事件发生以及合理安排训练计划。', '0.00', '0.00', '2019-05-31 01:30:12', '2019-05-31 01:30:12');
INSERT INTO `ieps_item_info` VALUES ('510135', '20190554499519', '1', '1', '水库预警信息系统主要针对国有公益性水利工程维修养护项目中为实现国家防总提出的适时报送小型水库的水雨情信息服务。现今水库监管预警主要方法是由人工实地水库进行测量采样，缺点在于水库一般处在远离城市的山区，人工测量会使信息无法第一时间进行获取，而且人员在频繁的往返于城市与水库之间，造成人力资源和物力资源的浪费，更因糟糕的环境引发安全问题。而采用水库预警系统可以将水库信息第一时间发送回数据库中心进行分析预测，且节约了人力和物力资源。', '0.00', '0.00', '2019-05-31 01:31:33', '2019-05-31 01:31:33');
INSERT INTO `ieps_item_info` VALUES ('510136', '20190571480263', '1', '1', '传统的智能地球仪主要是通过点读笔等辅助工具实现定位，需要预先把地理信息等数据存储在地球仪中，通过辅助工具定位并输出信息，结构简单却导致信息更新不方便，使用不方便。本项目拟研究一款基于语音识别和控制技术的智能地球仪，其采用语音识别技术与嵌入式技术相结合，能够识别非特定人的语音，并根据识别结果控制地球仪播放信息。项目拟通过使用单片机控制模块、语音识别模块及声控模块电路，使智能地球仪能识别用户说出的国家名称，并语音播放该地各种地理信息；通过WIFI收发模块可以让地球仪通过手机接入互联网，及时更新信息，使得地球仪信息更新智能化。项目成果能有效促进物联网技术在教育领域的发展。', '0.00', '0.00', '2019-05-31 01:32:51', '2019-05-31 01:32:51');
INSERT INTO `ieps_item_info` VALUES ('510137', '20190514393105', '1', '1', '随着国民经济、国防建设的不断发展，高精度时间同步已经成为通信、电力、军事等工程领域不可缺少的基础保障之一。全球定位系统可以提供全天候、高精度、低成本的授时导航信息，已获得了极其广泛的应用，而为了在大尺度空间上工程中应用于各平台，需要一个足够高精度的时间同步系统。本项目旨在基于FPGA，设计精度达皮秒级、低成本、低功耗的时间同步系统，以实现为各平台提供统一的时间和频率，同时失去天基信号后，仍能在一段时间内维系大系统的时间统一。', '0.00', '0.00', '2019-05-31 01:34:43', '2019-05-31 01:34:43');
INSERT INTO `ieps_item_info` VALUES ('510138', '20190515558931', '1', '1', '北斗智能形变监测客户端软件支持信息实时传输、实时显示和报警提示等。界面内容注重人性化设计，形象生动，直观简约。基于B/S构架可远程查看监测结果，分布式服务开发支持手机移动客户端登陆系统，方便快捷查看数据和报警信息。可实现对桥梁、大坝、电力杆塔、公路边坡、尾矿库、采空区沉降以及路基沉降等形变实时监测，科学分析形变发展趋势、智能预警。', '0.00', '0.00', '2019-05-31 01:35:35', '2019-05-31 01:35:35');
INSERT INTO `ieps_item_info` VALUES ('510139', '20190509326855', '1', '1', '随着卫星导航领域的不断发展，人们对RTK等技术的不断优化，接收机的定位精度不断提升。高精度接收机可以对目标对象的形变进行监测，利用实时或事后处理方法为用户提供高精度和形变信息。可用于地质灾害、尾矿、交通、水利水电等领域，适用于滑坡形变监测、矿区边坡监测、桥梁形变监测、大坝形变监测、沉降监测等。\n目前接收机有两个方面亟待改进，一方面是低成本高精度定位，另一方面是实现多接口功能。本项目通过STM32F407+Ublox多接口设计，预留多接口支持多种外设接口，如：串口、网口、雨量计、裂缝计和温湿度计等。使接收机的应用更加广泛，提升了接收机的兼容性、通用性和实用性等。', '0.00', '0.00', '2019-05-31 12:10:55', '2019-05-31 12:10:55');
INSERT INTO `ieps_item_info` VALUES ('510140', '20190525113254', '1', '1', '随着北斗高精度接收机芯片化，可以将对目标对象的形变进行卫星监测，并把形变量以卫星原始观测数据输出，利用实时或事后处理方法为用户提供形变信息。可用于地质灾害、尾矿、交通、水利水电等领域，适用于滑坡形变监测、矿区边坡监测、桥梁形变监测、大坝形变监测、沉降监测（高铁、高速公路电力塔杆、建筑基坑、地表沉降）等。\n然而在复杂监测环境下，如何完成稳定可靠近距离传输是个重要的问题。本项目通过无线网桥或LoRa组网方式旨在解决卫星数据传输中关键性问题。', '0.00', '0.00', '2019-05-31 12:12:36', '2019-05-31 12:12:36');
INSERT INTO `ieps_item_info` VALUES ('510141', '20190578502535', '1', '1', '随着导航技术的日益发展，高动态飞行载体在民用和军事领域的应用日益普遍，基于BDS的飞行载体测姿系统的需求逐渐增大。为此本项目设计无人机BDS-RTK/惯性组合定向测姿系统，该系统通过BDS-RTK三天线定向测姿及MEMS微惯性传感姿态解算的数据融合，实现飞行器等高动态载体实时姿态角测量及姿态精准控制，具有环境适应力能力强、计算量小、误差小、更新率高、稳定性高、实时性强、高精度的姿态测量的能力，而保障了无人机在飞行过程中的安全和稳定。', '0.00', '0.00', '2019-05-31 12:14:46', '2019-05-31 12:14:46');
INSERT INTO `ieps_item_info` VALUES ('510142', '20190548714510', '1', '1', '本项目结合电压俘能技术，设计开发一种基于压电俘能的无源自供电振动传感器，建立多振子并联压电振动俘能器模型，采用Ansys有限元分析软件建立压电俘能器的三维模型并对压电性能进行仿真分析，试制基于压电俘能的无源自供电振动传感器样机，设计压电俘能器的整流桥、滤波电容以及蓄电池构成交流-直流的电能收集与存储系统，通过现场实测对压电俘能器的压电性能及振动传感器的测试精度进行分析，验证于压电俘能的无源自供电振动传感器系统的稳定性及可靠性。项目成果对实现机械设备的无源供电振动信号监测提供了一种全新的方法和技术手段。', '0.00', '0.00', '2019-05-31 12:16:43', '2019-05-31 12:16:43');
INSERT INTO `ieps_item_info` VALUES ('510143', '20190568423065', '1', '1', '由于药品的特殊性质，药瓶上的一维码标签要求100%检测，而高速的生产，人工检测是无法达到的。针对这种情况，拟开发一套药盒标签有无视觉检测系统，以提高检测的效率和准确度。功能有：1、 在线自动检测一维码标签有无；2、自动剔除信号输出；3、实时统计检测数据，精确记录当前生产情况；4、可按照不同产品型号，建立不同工程文件，快速切换程序；5、可视化监控，实时可见当前产品生产质量情况。', '0.00', '0.00', '2019-05-31 12:19:01', '2019-05-31 12:19:01');
INSERT INTO `ieps_item_info` VALUES ('510144', '20190503218323', '1', '1', 'EFO打火成球电路是半导体二极管、三极管焊线设备上用于高压打火成球的电路系统。它的原理是通过高压将空气击穿，并在击穿后根据打火电流的大小和持续时间来形成预期大小的焊球。打火成球的意义在于金丝成球增大了换能器瓷嘴与焊接晶片接触面积，通过快速提高焊线材料与晶片的温度以提升焊接质量。目前国内打火成球系统还普遍停留在模拟系统方面，存在着数字化程度低、控制精度低、集成度低等问题，因此采取数字式打火成球系统能有效解决以上存在的问题。', '0.00', '0.00', '2019-05-31 12:29:24', '2019-05-31 12:29:24');
INSERT INTO `ieps_item_info` VALUES ('510145', '20190543174909', '1', '1', '水陆两用自行车是对现有的自行车进行改装，适应水陆两用的便捷交通工具。后轮为双轮胎结构，漂浮装置设立在轮胎上，陆地上和水里都是通过脚踩式推动前进。此交通工具具有广泛的实用性，娱乐，河道应急等。', '0.00', '0.00', '2019-05-31 12:30:38', '2019-05-31 12:30:38');
INSERT INTO `ieps_item_info` VALUES ('510146', '20190500018673', '1', '1', '本项目是在现有激光测量系统的基础上，总结国内外激光测量系统的研究现状和发展前景。通过综合分析现有的各种激光测量系统后发现，现有的激光测量设备虽然能够对被测物体进行高精度的测量，但是，在对被测物体进行测量之前需要在被测物体的定位和夹装上花费大量的时间和精力。特别是对被则物体进行三维测量时和三维模型的重建时，不仅要花费大量的时间对被测物体进行定位夹装，而且还有求操作人员具有相当丰富的经验。针对现有的激光测量系统存在的这些问题，本项目将以实际应用为目标，将现有激光测量系统与工业机器人相结合，设计一种新的激光测量系统。 ', '0.00', '0.00', '2019-05-31 12:32:16', '2019-05-31 12:32:16');
INSERT INTO `ieps_item_info` VALUES ('510147', '20190551801911', '1', '1', '本项目为远程监控智能污水流量监测系统的开发研究，通过结合超声波测距、传感器技术,无线通信和智能控制等技术，实现对污水流量监测系统的开启和污水流量的远程智能监控功能。仪表工作时，超声传感器不与被测流体接触，避免了渠道内污水的沾污和腐蚀。采用标准巴歇尔槽结构，只需测量入口液面高度一个参数便可获得污水流量实时流量，并可以实现流量累计、传输、超量报警、实时查看和远程数据打印等功能，较其它形式的仪表，具有更高的可靠性。', '0.00', '0.00', '2019-05-31 12:33:49', '2019-05-31 12:33:49');
INSERT INTO `ieps_item_info` VALUES ('510148', '20190570076886', '1', '1', '传统分拣采用人工分拣方式，易受人为因素影响，工作速度慢、分拣人工成本高等。拟采用视觉伺服引导技术，开发一个智能分拣系统，利用机器视觉技术，结合SCARA机械手对不同形状、尺寸等的物体进行分拣，实现智能分拣的功能，以提高分拣效率。', '0.00', '0.00', '2019-05-31 12:36:33', '2019-05-31 12:36:33');
INSERT INTO `ieps_item_info` VALUES ('510149', '20190597462127', '1', '1', '为了提高物体分拣搬运的速度和效率,减少人力的投入,从而设计一套地面自动化仓储机器人,以单片机为核心,用各种传感器来判断识别物体,判断距离,用舵机和机械手抓取物体,系统应用PID 算法分别控制减速电机同步运行.应用循迹折返算法,可以实现特定区域进行搜索识别和物体抓取搬运。', '0.00', '0.00', '2019-05-31 12:37:59', '2019-05-31 12:37:59');
INSERT INTO `ieps_item_info` VALUES ('510150', '20190595646485', '1', '1', '    该装置，打破了传统的电力传动洗衣方式，也跟目前市场上的“自行车洗衣机”有所不同。市场上的人力洗衣机，一般是采用人坐在自行车上脚踩脚踏板来产生动力，而我们这个装置不仅可以用脚踩来产生动力，还可以用手摇来产生动力，所以既可以使大腿得到锻炼，又可以使手部得到锻炼，在洗衣的同时大大提高了健身质量。这种健身洗衣机可放在家里使用或放在健身房里使用，将衣物清洗和健身相结合，全身都得到锻炼，有效提高了生活质量。', '0.00', '0.00', '2019-05-31 12:39:45', '2019-05-31 12:39:45');
INSERT INTO `ieps_item_info` VALUES ('510151', '20190596903775', '1', '1', '为更好解决目前传统检测结构裂纹缺陷位置，深度与大小的精度低，对结构的宏观缺陷敏感度不足等问题，本项目拟采用超声导波裂纹层析成像的方法来实现对腐蚀缺陷定位的检测。项目基于MATLAB平台，通过数据采集设备，将采集到的数据进行有限元分析、数值模拟，对二者的结果进行对比整合，实现对结构中的裂纹损伤的监测评估以及重构。技术具备检测精度高，检测速度快，检测费用低，远距离检测等特点。', '0.00', '0.00', '2019-05-31 12:41:42', '2019-05-31 12:41:42');
INSERT INTO `ieps_item_info` VALUES ('510152', '20190503607798', '1', '1', '为了解决目前髓内钉手术中远端锁钉锁定的难点，受手术者的手术技巧经验及术中C型臂X射线机的制约等不足，本项目拟采用一种基于电磁检测的方法来实时对手术过程中髓内钉的远端定位进行检测，从体外对髓内锁钉孔进行定位。项目采用磁场导航定位方法，利用ANSYS仿真软件来来模拟定位系统中的磁场分布情况，从而确定锁钉孔位置。', '0.00', '0.00', '2019-05-31 12:43:04', '2019-05-31 12:43:04');
INSERT INTO `ieps_item_info` VALUES ('510153', '20190566811313', '1', '1', '本项目主要研究一种底盘可全向移动并且可主动悬挂的移动搬运平台。它使用麦克纳姆轮实现平台灵活的全向移动。利用压缩空气作为轮系升降的动力源，利用陀螺仪和比例阀实现对每个轮系的升降闭环控制，迅速调整整个平台的姿态角度。在各种避震项目中能提供很好的方法，精致武器的运输，生物化学药物的运输，伤员的转移，铁路方面，日常车辆发挥着重要的作用。同时配备机械臂、云台实现夹取和图像传输功能。', '0.00', '0.00', '2019-05-31 12:44:34', '2019-05-31 12:44:34');
INSERT INTO `ieps_item_info` VALUES ('510154', '20190582340888', '1', '1', '我国城市化进展突飞猛进，城市交通日益拥挤。随着续航能力的提高，电动车成为人们首选的短途出行的绿色环保交通工具。在拥挤的停车场，电动车的停放、取车是一个繁琐费力的事情，尤其对于一些力气较小的女性来说，更是困难。\n因此，本课题对电动车进行适当的改造，设计集成在电动车上的自动泊车装置，并开发手机APP，实现通过手机控制自动车的任意方向旋转与平动、后支架的自动收放，并通过停车场的地下定位器，实现电动车的一键停车、一键取车。', '0.00', '0.00', '2019-05-31 12:46:27', '2019-05-31 12:46:27');
INSERT INTO `ieps_item_info` VALUES ('510155', '20190515160876', '1', '1', '随着智能家居高度发展，为方便人们离家时给室内盆栽灌溉，拟设计一套宜家式盆栽智能灌溉系统，主要功能有：土壤湿度检测，根据土壤湿度情况自动进行浇水灌溉；通风散热功能，温度超过植物适宜温度，自动开启风扇通风；数据存储功能：将浇灌的数据、检测温度湿度等数据存储，可通过SD卡或其他手段进行输出，以方便后续的数据采集管理；可多点扩展，实现多盆栽的自动灌溉。', '0.00', '0.00', '2019-05-31 12:47:34', '2019-05-31 12:47:34');
INSERT INTO `ieps_item_info` VALUES ('510156', '20190591950910', '1', '1', '随着电子系统设计的高密度集成、高频率等特性的不断增加,对电源的设计提出了更高的要求，而电源的布局布线对电源负载性能的影响占据着重要的地位，电源不合理甚至错误的布局布线不仅对元器件造成损坏而且影响电源的性能。在电源设计中进行合理的布局布线能有效提高电源的可靠性、稳定性、安全性，同时提高转化效率，降低干扰等，使电源更加的可靠耐用，经济实惠，高效节能，绿色环保，具有广阔的市场应用前景。', '0.00', '0.00', '2019-05-31 12:49:43', '2019-05-31 12:49:43');
INSERT INTO `ieps_item_info` VALUES ('510157', '20190505754322', '1', '1', '本项目拟以结构稳定的钛酸锂材料为母体，硅材料为贡献能量密度主体，采用双靶共溅射方法直接制备出高能量密度钛酸锂-硅复合薄膜。研究溅射工艺参数对材料颗粒大小、形貌和堆积方式的影响以及对材料电化学性能的影响，制备出高能量密度钛酸锂-硅复合材料。采用对薄膜充放电曲线求导数、取对数和薄膜不同电位电化学阻抗分析相结合的方法，探明锂离子在薄膜中的扩散和传输方式，揭示出钛酸锂-硅复合薄膜的脱/嵌锂机理。', '0.00', '0.00', '2019-05-31 12:50:50', '2019-05-31 12:50:50');
INSERT INTO `ieps_item_info` VALUES ('510158', '20190560134777', '1', '1', '在电子信息技术不断飞速发展的当下，电池能量密度的提高却极其有限，电池已经成为了制约信息技术发展的瓶颈。便携式的电子产品必须频繁充电或更换电池才可可满足日常需求。而在人体日常活动时便可产生大量的动能，若将这些被人们忽视的能量进行收集，配以高效的电池管理系统，并对便携电子设备进行充电或者构成自供电系统不失为行之有效的方案。基于上述背景本课题遵循以人为本、在不影响人体正常生活的前提下，研发具有独立知识产权的人体能量发电型的能量储能系统。', '0.00', '0.00', '2019-05-31 12:51:59', '2019-05-31 12:51:59');
INSERT INTO `ieps_item_info` VALUES ('510159', '20190527937653', '1', '1', '弹性按键是电子产品的重要组成。现有贴片式单体硅橡胶弹性按键手感轻软，很难满足某些手感要求较强的场合，且现有轻触开关的生产过程涉及不同组件的组装，人力/材料成本高，致使轻触开关按键的整体成本较高；同时，现有轻触开关的各组件均有高度，且相互间有配合公差要求，进一步减小轻触开关的高度、大小受限较大，且尺寸变小容易进一步提高按键的组装难度和成本。本项目拟一体化结构设计思路，研发集成锅仔片的新型贴片式大手感单体弹性按键。', '0.00', '0.00', '2019-05-31 12:53:07', '2019-05-31 12:53:07');
